import React from 'react';
import MessagesButton from './components/messagesButton';
import FriendRequestSendButton from './components/sendFriendRequest';
import IncomingRequestsList from './components/IncomingRequestsList';

const App = () => {
    if (document.getElementById('messages-root')) {
        return <MessagesButton />;
    } else if (document.getElementById('friend-request-root')) {
        return <FriendRequestSendButton />;
    } else if (document.getElementById('incoming-requests-root')) {
        return <IncomingRequestsList />;
    }
    return null;  //Default case if none of the conditions match.
};

export default App;
